import React from "react";
import { testimonialPhotos } from '../../photoData'; // Adjust the path as necessary

function Testimonials() {
  return (
    <div>
      <h1>Testimonials</h1>
      {testimonialPhotos.map((photo) => (
        <img
          key={photo.id}
          src={photo.url}
          alt={`Testimonial ${photo.id}`}
          style={{ width: '100px', margin: '10px' }}
        />
      ))}
    </div>
  );
}

export default Testimonials;
